interface SpanProps {
    label: string;
    color: string;
}

const Span: React.FC<SpanProps> = ({label, color}) => {

    const backgroundAndTextColor = `bg-${color}-200 text-${color}-500`
    return <>
        <span className={"px-3.5 py-1.5 " + backgroundAndTextColor} >
            {label}
        </span>    
    </>
}

export default Span;
